INSERT INTO `generalsettings` (`generalid`, `heading1`, `heading2`, `content1`, `content2`, `content3`, `map`, `Footer_Block`, `Facebook_script`, `Before_Head`, `After_Body`, `Copyrights`, `gold_rate`, `silver_rate`, `OG_Tag`, `ip`, `date`, `status`, `updated_id`, `updated_type`) VALUES
(1, '<a href=\"tel:+ (91) 452 3244185\"><i class=\"fa fa-phone\" aria-hidden=\"true\"></i>  + (91) 452 3244185</a>', '<a href=\"mailto:reservations@heritagemadurai.com\"> <i class=\"fa fa-envelope\" aria-hidden=\"true\"></i> reservations@heritagemadurai.com</a>', '<a target=\"_blank\" href=\"https://www.tripadvisor.in/Hotel_Review-g297677-d1229352-Reviews-Heritage_Madurai-Madurai_Madurai_District_Tamil_Nadu.html\"><img src=\"http://www.nbayjobs.com/heritage/images/tripadvisor.png\" alt=\"TripAdvisor\" /></a>', '<strong>Heritage Madurai,\r\n                                11, Melakkal Main Road, Kochadai,<br>\r\n                                Madurai 625 016, India.<br>\r\n                                Tel : + (91) 452 2385455, + (91) 452 3244185 <br>   Fax : + (91) 452 2383001 </strong>', '09.00 hrs to 18.00 hrs  mon - Fri <br>09.00hrs to 13.00 hrs Saturday. <br>Sunday holiday. <br>', '<iframe data-cfasync=\"true\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15720.06639703362!2d78.09640507012342!3d9.932575236357472!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x783a43e7763b997e!2sHeritage+Madurai!5e0!3m2!1sen!2sin!4v1515252442774\" width=\"100%\" height=\"260\"  frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe>', 'Heritage Madurai was built in 1923 as the residence for the British officers of the Madura coats a pioneering textile company, that went on to build brands such a Louise Philippe and Van Husen. In the 1970s the renowned Srilankan architect Geoffery Bawa built the club house on the grounds of the officers bungalows. Using honey colored granite, materials and artisans from within 20 miles of Madurai he created a landmark Bawa structure. Today this building functions as our restaurant and coffee shop.', '<div id=\"fb-root\"></div>\r\n                        <script>(function (d, s, id) {\r\n                                var js, fjs = d.getElementsByTagName(s)[0];\r\n                                if (d.getElementById(id))\r\n                                    return;\r\n                                js = d.createElement(s);\r\n                                js.id = id;\r\n                                js.src = \"//connect.facebook.net/en_US/sdk.js#xfbml=1&version=v2.3\";\r\n                                fjs.parentNode.insertBefore(js, fjs);\r\n                            }(document, \'script\', \'facebook-jssdk\'));</script>\r\n                        <div class=\"fb-page\" data-href=\"https://www.facebook.com/Heritagemadurairesort/\" data-hide-cover=\"false\" data-show-facepile=\"true\" data-show-posts=\"false\">\r\n                            <div class=\"fb-xfbml-parse-ignore\">\r\n                                <blockquote cite=\"https://www.facebook.com/Heritagemadurairesort/\">\r\n                                    <a href=\"https://www.facebook.com/Heritagemadurairesort/\">Facebook</a>\r\n                                </blockquote>\r\n                            </div>\r\n                        </div>', '', '', 'Copyright  2016 Grandluxe Hotels India. All Rights Reserved.', '4500', '450', '<meta property=\"og:type\" content=\"website\" /> \r\n<meta property=\"og:locale\" content=\"en-IN\" /> \r\n<meta property=\"og:twitter:site\" content=\"@Heritagemadurai\" /> \r\n<meta property=\"og:copyrights\" content=\"\" /> \r\n<meta property=\"og:author\" content=\"\" /> \r\n<meta property=\"og:publisher\" content=\"\" /> \r\n<meta property=\"og:summary\" content=\"\" />', '192.168.1.18', '2017-08-22', 1, 1, 'admin');
